body {
  text-align: center;
  font-size: 20px;
  padding: 2.5%;
  font-family: 'RobotoCondensed';
}

h1, h2, h3, h4, h5 {
  font-family: 'EconomicaBold';
}

.track {
  width:250px;
  height:250px;
  display:inline-block;
  position:relative;
  margin:20px;
  cursor: pointer;
}

.track-image {
  width:250px;
  height:250px;
}

.track-text {
  background-color:#000;
  color:#fff;
  position:absolute;
  width:250px;
  bottom:0;
  padding:5px;
}

.track-icon {
  position:absolute;
  bottom:100px;
  left:100px;
  color:#fff;
  background:#000;
  width:50px;
  height:50px;
  border-radius:25px;
  padding:10px;
  opacity: 0.8;
}
